import React from 'react';

function About() {
	return (
		<div className="padding">
          
			<ul className="list-group list-group-flush padding" >
				<li className="list-group-item bg-info text-white text-center">   Turlar Dünyası</li>
				<li className="list-group-item bg-info text-white">Bu site iş yeri eğitimi projesi olarak yapılmıştır</li>
				<li className="list-group-item bg-info text-white" >Bir front-end uygulmasıdır ve  <b>react.js</b>  ile gerçekleştirilmiştir</li>
			</ul>
		</div>
	);
}
export default About;
